import React from "react";
import { Row, Col } from "antd";
import Avatar1 from "../image/avatar1.jpg";
import Avatar2 from "../image/avatar2.jpg";
import "antd/dist/antd.css";
import { HeartFilled } from "@ant-design/icons";
import "./Avatar.css";

class Avatar extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <>
        <Row>
          <Col span={8}>
            <div style={{ float: "right", padding: "10px" }}>
              <img
                style={{
                  width: "90px",
                  height: "90px",
                  borderRadius: "50%",
                  objectFit: "cover",
                  border: "4px #f3c568 solid",
                }}
                src={Avatar1}
                alt="avatar"
              ></img>
            </div>
          </Col>
          <Col span={8}>
            <div class="HeartBeat" style={{ width: "100%", height: "100%" }}>
              <HeartFilled
                style={{
                  color: "#f3c568",
                }}
              />
            </div>
          </Col>
          <Col span={8}>
            <div style={{ float: "left", padding: "10px" }}>
              <img
                style={{
                  width: "90px",
                  height: "90px",
                  borderRadius: "50%",
                  objectFit: "cover",
                  border: "4px #f3c568 solid",
                }}
                src={Avatar2}
                alt="avatar"
              ></img>
            </div>
          </Col>
        </Row>
      </>
    );
  }
}

export default Avatar;
